import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the main content area to be present
    await page.waitForSelector('#mainContent', { timeout: 5000 });

    // Try to find the "Electronics" category card by its text
    // Use a different selector: XPath for the div with class 'category-card' containing 'Electronics'
    const [electronicsCard] = await page.$x("//div[contains(@class,'category-card')][.//h3[contains(text(),'Electronics')] or contains(normalize-space(),'Electronics')]");
    if (!electronicsCard) {
      throw new Error('Electronics category card not found');
    }

    // Take screenshot before clicking
    const step2 = path.join(screenshotsDir, 'step_2_electronics_card.png');
    await electronicsCard.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the Electronics category card
    await electronicsCard.click();

    // Wait for the category results to appear (look for h2 with text 'Electronics')
    await page.waitForSelector("h2", { timeout: 5000 });
    // Use XPath to find the h2 with text 'Electronics'
    const [categoryHeader] = await page.$x("//h2[contains(text(),'Electronics')]");
    if (!categoryHeader) {
      throw new Error('Electronics category page did not load');
    }

    // Take screenshot after navigation
    const step3 = path.join(screenshotsDir, 'step_3_electronics_category.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the number of products shown in the results count
    const resultsCountElem = await page.$(".results-count");
    let resultsCountText = '';
    if (resultsCountElem) {
      resultsCountText = (await resultsCountElem.textContent()).trim();
    }

    return {
      success: true,
      action: "Navigated to Electronics category via category card and verified category page loaded",
      extractedData: {
        categoryHeader: await categoryHeader.textContent(),
        resultsCount: resultsCountText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
